(1099, 1, '2016-05-18 04:23:15', '2016-05-18 04:23:15', '[vc_row][vc_column][vc_single_image image=\"1100\" img_size=\"full\" alignment=\"center\"][vc_row_inner content_placement=\"bottom\" css=\".vc_custom_1463554766763{margin-top: 60px !important;}\"][vc_column_inner][vc_column_text]\r\n<h2><strong>Çamkıran İç ve Dış Ticaret</strong></h2>\r\n1989 yılında İtalyan Arneg firmasının Türkiye temsilciliğini alarak perakende piyasasına giren firmamız, artan iş potansiyeli ve Türkiye pazarında giderek yükselen kalite beklentileri sonucu 1994 yılında şirketleşmiş ve faaliyetlerini distribütör olarak da sürdürmeye başlamıştır.\r\n\r\nÇamkıran İç ve Dış Ticaret’in faaliyet alanını süpermarket ekipmanları, plastik müşteri arabaları ve sepetleri oluşturmaktadır. Perakende sektörüne sunduğumuz başlıca ürünlerimiz; alışveriş arabaları ve sepetleri, soğutucu dolaplar, soğutma sistemleri, soğuk oda panelleri, raf sistemleri, kasa çıkış üniteleridir.\r\n\r\n30 yıllık iş tecrübesi içerisinde Çamkıran, Türkiye’de gerçekten kaliteli ekipman kullanmayı şirket politikası olarak benimsemiş kuruluşlara ait olan yüzlerce mağazanın soğutucu dolap, raf, soğuk oda, kasa çıkış üniteleri ve alışveriş arabaları gibi ekipmanlarını sağlamıştır. Bu mağazaların kurulumunda özverili ve titiz çalışmalar ile en ideal şartlarda ve sürelerde sağlanan ekipmanların yıllarca kullanılabilmesi müşterilerimizle aramızda sağlam bir bağ oluşturmuştur.\r\n\r\nÇamkıran, İtalya merkezli Plastimark, Arneg Grup (Arneg, Intrac, Incold, Oscartielle),&nbsp; gibi konularında uzman, dizayn, kalite, estetik, sağlamlık ve fonksiyonel olma gibi özellikleri ile yüksek seviyede kabul görmüş, dünyanın ve avrupanın önde gelen firmaları ile iş ortağı olmanın sağladığı avantajlar sayesinde, mükemmel müşteri memnuniyetini bugüne kadar sağlamış ve bu memnuniyeti sürekli artırmayı ilke olarak benimsemiştir.\r\n\r\nFarklı alternatiflerle, uzun yıllar sorun çıkarmayan ürünlerimizi, satış sonrası özel destek ile birlikte sunabilen firmamız ile tanışarak sizleri de mutlu müşterilerimiz&nbsp; arasında görmekten onur duyarız.[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]', 'Hakkımızda', '', 'publish', 'closed', 'closed', '', 'hakkimizda', '', '', '2018-10-26 16:19:54', '2018-10-26 13:19:54', '', 0, 'http://www.camkiran.com/?page_id=1099', 0, 'page', '', 0),
