(4273, 2, '2018-07-23 17:03:36', '2018-07-23 14:03:36', '66 Litre, artırabilir kapasite\r\nStandart renkler; KIRMIZI Ral 3020, MAVİ Ral 5015, YEŞİL Ral 6005\r\nKaliteli plastik malzemeden üretilmiştir.\r\n%100 Geri dönüşümlü ve ekolojiktir.\r\nBenzerlerinden daha fazla ürün taşır (66 Litre)\r\nÜzerine ek olarak Tyko ve Minityko alışveriş sepeti takılabilme özelliği.\r\nMinityko el sepeti ile 88 Litre, Tyko el sepeti ile 99 Litre kapasite\r\nÇekerek veya iterek kolayca taşınır.\r\nİki sabit, iki hareketli \"süper\" sessiz, kırılmaz tekerleklerle sorunsuz kolay kullanım\r\nEn 50, derinlik 67 cm, sepet yüksekliği 47 cm, tutacak yüksekliği 94,5 cm\r\nİç içe geçer, istifleme mesafesi 9,5 cm\r\nGeniş ve dar alanlar için oldukça uygundur.\r\nİstenilen renklerde üretilebilir. (Minimum sipariş 300 adet)\r\nTÜV güvenlik sertifikası\r\nAğırlık 2,85 kg', 'Maxi Tyko - Yeni', '66 Litre, artırabilir kapasite\r\nStandart renkler...', 'publish', 'closed', 'closed', '', 'maxi-tyko-yeni', '', '', '2018-11-19 13:52:59', '2018-11-19 10:52:59', '', 0, 'http://www.camkiran.com/?post_type=product&#038;p=4273', 4, 'product', '', 0),
