(4354, 2, '2018-07-24 10:21:12', '2018-07-24 07:21:12', '<strong>Market arabası</strong> satın alırken nelere dikkat edilmelidir?\r\n\r\n- Kürersel ısınmanın kapımıza dayandığı bu günlerde, çevreci ürünleri tercih etmeliyiz\r\n- Oksitlenip, her yol boyma, galvanizleme istemeyen ürün tercih etmeliyiz\r\n- Tekerlekleri dayanıklı, kırılmayan, sessiz olmalıdır\r\n- Anti statik olmalıdır\r\n- Fiyat/kullanım dengesi yüksek olmalıdır\r\n- Kişiselleştirilebilir olmalıdır ki firmamızın özelliklerini yansıtabilelim.\r\n\r\n- Tüm bu özellikleri taşıyan ürünlerimizi güvenle yıllarca kullanabilirsiniz', 'Market arabası satın alırken nelere dikkat edilmelidir?', '', 'publish', 'open', 'open', '', 'baslik', '', '', '2018-07-24 10:41:52', '2018-07-24 07:41:52', '', 0, 'http://www.camkiran.com/?p=4354', 0, 'post', '', 0),
(4362, 2, '2018-07-24 10:42:42', '2018-07-24 07:42:42', '<strong>Market sepeti</strong> satın alırken nelere dikkat edilmelidir?\r\n\r\n-Dayanıklı malzemelerden mi üretilmiş?\r\n- Çabuk kırılan ve deforme olmayan malzeme mi?\r\n- Ergonomik mi?\r\n- Taşırken ağırlığı hissettiriyor mu?\r\n- Taşırken bize sıkıntı veriyor mu?\r\n- Kalitesi tescilli mi?\r\n- Ürünümüzün özel olarak dizayn edilmesi sayesinde yukarıdaki soruların tümüne yanıt verebilmektedir.\r\n\r\nMevcut ürünler dikdörtgen yapıdadır ve tutacak kısa kenar üzerindedir. Dolayısı ile siz sepeti tutarken bileğinizi bükmek veya sepetin bacağınıza daha fazla çarpması ile karşılaşırsınız. Minityko ve Tyko sepetlerimizde böyle bir sorun yoktur.\r\nSepetler bacağa çarpmaması için iç kısmı yay biçiminde dizay edilmiş ve sapı uzun kenar üzerine takılmıştır. Bu sayede bileğiniz vücudunuza dik kalır ve ağır yükleri dahi zorlanmadan taşıyabilirsiniz.', 'Market sepeti satın alırken nelere dikkat edilmelidir?', '', 'publish', 'open', 'open', '', 'market-sepeti-satin-alirken-nelere-dikkat-edilmelidir', '', '', '2018-07-24 10:51:56', '2018-07-24 07:51:56', '', 0, 'http://www.camkiran.com/?p=4362', 0, 'post', '', 0),
