(4711, 3, '2018-09-06 16:59:07', '2018-09-06 13:59:07', 'MULTİ METAL Sepet Taşıyıcı ve 2 adet TYKO sepetten oluşur\r\nMULTİ METAL, aynı zamanda MINITYKO ve SPEESY de taşıyabilir\r\nMULTİ METAL ile aşağıdaki şekillerde taşıma yapabilirsiniz;\r\n2 TYKO (1 adet üstte, 1 adet altta – Toplam 66 Litre)\r\n1 MINITYKO (üstte), 1 TYKO (altta – Toplam 55 Litre)\r\n1 MINITYKO (üstte), 1 SPEESY (altta – Toplam 67 Litre)\r\n1 TYKO (üstte), 1 SPEESY (altta – Toplam 78 Litre)', 'Multi Sistem (Multi Metal + 2 adet Tyko)', '', 'publish', 'closed', 'closed', '', 'multi-sistem', '', '', '2018-11-06 14:01:32', '2018-11-06 11:01:32', '', 0, 'http://www.camkiran.com/?post_type=product&#038;p=4711', 8, 'product', '', 0);
