(4734, 2, '2018-10-15 16:44:17', '2018-10-15 13:44:17', '<p class=\"myo\"><strong>Küçük marketler için özel tasarlanmıştır</strong>\r\n100 Litre\r\nEkolojik:%100 geri dönüştürülebilir\r\nStandart tutacak ve çerçeve\r\nTutacak bölümünde logo konulabilir\r\nİsteğe bağlı para yuvası entegre edilebilir\r\nElektrostatik yük taşımaz\r\nSessiz dayanıklı tekerlekler\r\nÜstün manevra kabiliyeti ile kolay kullanım, tüm çerçevden çekerek kullanılabilir\r\nStandart renk ; Sepet Koyu Kahve, Tuyacak ve çerçeve Kırmızı Ral 3020, Mavi Ral 5002, Yeşil P375C, Sarı Ral 1023, Turuncu Ral 2008 ve Mor 4006\r\nİstenilen renklerde üretilir\r\nRFID Uyumlu\r\nØ 100 mm standart, 125 standart ve yürüyen yola uyumlu tekerlekler\r\nUV ve hava koşullarına dayanıklı\r\nİç içe geçer, istifleme mesafesi 13 cm\r\nTÜV güvenlik sertifikası\r\nEn 460 mm\r\nBoy 750 mm\r\nYükseklik 1050 mm</p>', 'Pleasy', '', 'publish', 'closed', 'closed', '', 'pleasy', '', '', '2018-11-19 14:04:40', '2018-11-19 11:04:40', '', 0, 'http://www.camkiran.com/?post_type=product&#038;p=4734', 0, 'product', '', 0),
